import React from 'react';
import "./Login.css";

import joLogo from "../../assets/jo-logo.svg";
import emoji from "../../assets/emoji.png";

const Login = () => {
    return (
        <div className="main-container custom-height">

            <div className="login-screen w-full max-w-6x1 flex items-start rounded-lg">

                <div className="div-azul">

                    <div className="jo-content flex flex-column gap-">
                        <div className="img-logo ">
                            <img src={joLogo} alt="" className='w-56 h-14'/>
                        </div>
                            <div className="h1-and-img flex">
                                <h1 className='text-5xl'>Descubra <br/> Aqui! </h1> 
                                <img src={emoji} alt="emoji" className='w-24'/>
                            </div>
                                <p className='text-lg font-thin'>A Jô, nossa assistente virtual, 
                                    tem um jeitinho todo especial 
                                    de se expressar: 
                                    ela adora interagir com emojis!
                                    Ao simplificar buscas e fornecer 
                                    informações sobre a fundação, 
                                    a Jô também se torna além de eficientes,
                                    mas também divertida e amigável para você.</p>
                        </div>

                </div>


                <div className="div-branca">
                    <h1 className="text-black"></h1>
                    <h1 className='text-black'>Fazer Login</h1>
                </div>
            </div>
        </div>
        
    );
};



export default Login;
